import { swiper,swiperSlide } from 'vue-awesome-swiper';
export default {
    components:{
        swiper,
        swiperSlide,
    },
    props: {
        cname:{
            type:String,
            default:''
        },
        //这个变量是swiper指定的变量
        options: {
            type:Object,
            //参数也是swiper指定的参数
            default(){
                return{
                    autoplay: true,
                    loop: true,
                    pagination:{
                        el:'.swiper-pagination',
                    },
                    notNextTick: false,
                }
            }
        },
        items: {
            type: Array,
            default() {
                return []
            }
        }
    }
    
}
